import './App.css';
import Home from './Home';
import Navbar from './Navbar'
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';

function App() {
  return (
    <Router>
      <>
        <Navbar />
          <div className='content'>
            <Routes>
              <Route path='/'>
                <Home />
              </Route>
            </Routes>
          </div>
      </>
    </Router>
  );
}

export default App;
